"<p>This website is powered by b2evolution.</p>\n\n<p>You are currently looking at an info page about \"%s\".</p>\n\n<p>Info pages are very much like regular posts, except that they do not appear in the regular flow of posts. They appear as info pages in the sidebar instead.</p>\n\n<p>If needed, an evoskin can format info pages differently from regular posts.</p>" => "<p>Ĉi tiu kolektaro estas kreita pere de b2evolution</p>.\n\n<p>Vi nune rigardas informan paĝon pri \"%s\".</p>\n\n<p>Informaj paĝoj estas tre similaj al ordinaraj afiŝoj escepte de tio, ke ili ne aperas en la regula fluo de afiŝoj. Ili anstataŭe aperas kiel informaj paĝoj en la flankaĵo.</p>\n\n<p>Se postulata, etoso povas aranĝi informajn paĝoj malsame de ordinaraj paĝoj.</p>.",
