'b2evo: The other blog tool!' => 'b2evolution: La alia kolekto-programo!',
"<p>This blog platform is powered by b2evolution.</p>\n\n<p>You are currently looking at an info page about this site.</p>\n\n<p>Info pages are very much like regular posts, except that they do not appear in the regular flow of posts. They appear as info pages in the sidebar instead.</p>\n\n<p>If needed, an evoskin can format info pages differently from regular posts.</p>" => "<p>Ĉi tiu kolekto estas kreita pere de b2evolution</p>.\n\n<p>Vi nune rigardas informan paĝon pri la kolektaro.</p>\n\n<p>Informaj paĝoj estas tre similaj je ordinaraj afiŝoj escepte de tio, ke ili ne aperas en la regula fluo de afiŝoj. Ili anstataŭe aperas kiel informaj paĝoj en la flankaĵo.</p>\n\n<p>Se postulata, etoso povas aranĝi informajn paĝoj alimaniere de ordinaraj paĝoj.</p>.",
'About this site' => 'Pri la kolektaro',
"<p>This is the Home page of this site.</p>\n\n<p>More specifically it is the \"Front page\" of the first collection of this site. This first collection is called \"Home\". Other sample collections have been created. You can access them by clicking \"Blog A\", \"Blog B\", \"Photos\", etc. in the menu bar at the top of this page.</p>\n\n<p>You can add collections at will. You can also remove them (including this \"Home\" collection) if you don't need one.</p>" => "<p>Ĉi tio estas la ĉefpaĝo de la kolektaro.</p>\n\n<p>Pli specife ĝi estas la \"Frontpaĝo\" de la unua kolekto de la kolektaro. La unua kolekto nomiĝas \"Hejmo\". Aliaj specimenaj kolektoj estis kreitaj. Vi povas atingi ilin per klako sur \"kolekto A\", \"kolekto B\", \"Fotoj\" ks en la menuzono je la supro de la paĝo.</p>\n\n<p>Vi rajtas laŭvole aldoni kolektojn. Vi ankaŭ rajtas forigi ilin (inkluzive de la kolekto \"Hejmo\") se vi ne plu bezonas ilin.</p>",
'Homepage post' => 'Ĉefpaĝa afiŝo',
"<p>This is the intro post for the front page of Blog A.</p>\n\n<p>Blog A is currently configured to show a front page like this one instead of directly showing the blog's posts.</p>\n\n<ul>\n<li>To view the blog's posts, click on \"News\" in the menu above.</li>\n<li>If you don't want to have such a front page, you can disable it in the Blog's settings > Features > <a %s>Front Page</a>. You can also see an example of a blog without a Front Page in Blog B</li>\n</ul>" => "<p>Jen enkonduka afiŝo por la ĉefpaĝo de kolekto A.</p>\n\n<p>Kolekto A aktuale agordiĝas por montri ĉefpaĝon kiel ĉi tion anstataŭ rekte montri la afiŝojn de la kolekto.</p>\n\n<ul>\n\t<li>Por rigardi la afiŝojn de la kolekto, klaku sur \"Novaĵoj\" en la supra menuo.</li>\n\t</i>Se vi ne volas havi tian ĉefpaĝon, estas eble malaktivigi ĝin en la agordo de kolekto &lt; Trajtoj &lt; <a %s>Ĉefpaĝo</>. Vi povas ankaŭ vidi ekzemplon de kolekto sen ĉefpaĝo en kolekto B</li>\n</ul>",
'Welcome to Blog A' => 'Bonvenon al kolekto A',
"<p>This is the first post.</p>\n\n<p>It appears in a single category.</p>" => "<p>Jen la unua afiŝo.</p>\n\n<p>Ĝi aperas en unuopa kategorio.</p>",
'First Post' => 'Unua afiŝo',
"<p>This is the second post.</p>\n\n<p>It appears in multiple categories.</p>" => "<p>Jen la dua afiŝo.</p>\n\n<p>Ĝi aperas en pluraj kategorioj.</p>",
'Second post' => 'Dua afiŝo',
'About Blog A' => 'Pri kolekto A',
'Blog A' => 'Kolekto A',
"<p>This is page 1 of a multipage post.</p>\n\n<blockquote><p>This is a Block Quote.</p></blockquote>\n\n<p>You can see the other pages by clicking on the links below the text.</p>" => "<p>Jen la unua paĝo de plurpaĝa afiŝo.</p>\n\n<blockquote><p>Jen bloka citaĵo.</p></blockquote>\n\n<p>Vi povas vidi la aliajn paĝojn per alklakado de la ligiloj sube de la teksto.</p>",
'This is a multipage post' => 'Jen plurpaĝa afiŝo',
'<p>This is page %d.</p>' => '<p>Jen paĝo %d.</p>',
'<p>It is the last page.</p>' => '<p>Ĝi estas la lasta paĝo.</p>',
'<p>This is an extended post with no teaser. This means that you won\'t see this teaser any more when you click the "more" link.</p>' => '<p>Jen etendita afiŝo kun neniu komenca eltiraĵo. Alivorte vi ne plu vidos la komencon kiam vi alklakos la ligilon "plu".</p>',
'Extended post with no teaser' => 'Etendita afiŝo sen komenca eltiraĵo',
'<p>This is the extended text. You only see it when you have clicked the "more" link.</p>' => '<p>Jen etendita teksto. Vi povas vidi ĝin post kiam vi alklakis la ligilon "pli".</p>',
'<p>This is an extended post. This means you only see this small teaser by default and you must click on the link below to see more.</p>' => '<p>Jen etendita afiŝo. Alivorte vi vidos nur ĉi tiun malgrandan komencan eltiraĵon kaj vi devos klaki sur la ligilo sube por pli vidi.</p>',
'Extended post' => 'Etendita afiŝo',
"<p>This post has several images attached to it. Each one uses a different Attachment Position. Each may be displayed differently depending on the skin they are viewed in.</p>\n\n<p>Check out the photoblog (accessible through the links at the top) to see a completely different skin focused more on the photos than on the blog text.</p>" => "<p>Ĉi tiu afiŝo havas plurajn bildojn almetitajn al ĝi. Ĉiu uzas malsaman kunsendaĵan pozicion. Ĉiu eblas malsame rigardata depende de tio, en kiu etoso ĝi estas vidata.</p>\n\n<p>Vidi la fotan kolekton (atingebla per la ligiloj supre de la paĝo) por vidi tute alian etoson pli taŭgan por fotoj ol por kolekto-teksto.</p>",
'Image post' => 'Bilda afiŝo',
'Welcome to your b2evolution-powered website!' => 'Bonvenon al b2evolution-kreita kolektaro!',
"<p>To get you started, the installer has automatically created several sample collections and populated them with some sample contents. Of course, this starter structure is all yours to edit. Until you do that, though, here's what you will find on this site:</p>\n\n<ul>\n<li><strong>Blog A</strong>: You are currently looking at it. It contains a few sample posts, using simple features of b2evolution.</li>\n<li><strong>Blog B</strong>: You can access it from the link at the top of the page. It contains information about more advanced features. Note that it is deliberately using a different skin from Blog A to give you an idea of what's possible.</li>\n<li><strong>Photos</strong>: This collection is an example of how you can use b2evolution to showcase photos, with photos grouped into photo albums.</li>\n<li><strong>Forums</strong>: This collection is a discussion forum (a.k.a. bulletin board) allowing your users to discuss among themselves.</li>\n<li><strong>Manual</strong>: This showcases how b2evolution can be used to publish structured content such as an online manual or book.</li>\n\n</ul>\n\n<p>You can add new collections of any type (blog, photos, forums, etc.), delete unwanted one and customize existing collections (title, sidebar, blog skin, widgets, etc.) from the admin interface.</p>" => "<p>Kiel ekzemplo la instalilo aŭtomate kreis kelkajn specimenajn kolektojn kun specimena enhavo. Kompreneble tiu specimena strukturo estas redaktenda. Antaŭ ol vi faros tion, jen tio, kio troveblas ĉe la kolektaro:</p>\n\n<ul>\n\t<li><strong>Kolekto A</strong>: Vi nune rigardas ĝin. Ĝi enhavas kelkajn specimenajn afiŝojn, uzante simplajn trajtojn de b2evolution.</li>\n\t<li><strong>Kolekto B</strong>: Vi povas atingi ĝin per ligilo ĉe la supro de la paĝo. Ĝi enhavas informojn pri pli altnivelaj trajtoj. Notu, ke ĝi laŭcele uzas alian etoson de kolekto A por montri al vi tion, kio eblas.</li>\n\t><li><strong>Fotoj</strong>: Tiu kolekto estas ekzemplo de kiel vi povas uzi b2evolution-on por elmontri fotojn, dividitajn en fotarojn.</li>\n\t<li><strong>Forumoj</strong>: Tiu kolekto estas diskuta forumo, permesante al vi lasi, ke uzantoj priparolu inter sin.</li>\n\t<li><strong>Manlibro</strong>: Tiu elmontras, kiel b2evolution uzeblas por publikigi enhavan strukturitan aŭ libran.</li>\n\n</ul>\n\n<p>vi povas aldoni novajn kolektojn ajnaspecajn (kolekton, fotojn, forumojn ktp), forigi nevolitajn kaj personigi jamajn kolekto-partojn (titolon, flankaĵon, etoson, umaĵojn ktp) en la stirilo.</p>",
'b2evo skins repository' => 'deponejo de b2evolution-etosojn',
'About Blog B' => 'Pri kolekto B',
'Blog B' => 'Kolekto B',
'Main Intro post' => 'Ĉefa enkonduka afiŝo',
'This is the main intro post. It appears on the homepage only.' => 'Jen la ĉefa enkonduka afiŝo. Ĝi nur aperas en la ĉefpago',
'This uses post type "Intro-Cat" and is attached to the desired Category(ies).' => 'Ĉi tio uzas afiŝtipon "Intro-Cat" kaj estas almetita al la dezirata kategorio(j).',
'b2evolution tips category &ndash; Sub Intro post' => 'b2evolution klinas kategorion &ndash; sub enkonduka afiŝo',
'This uses post type "Intro-Tag" and is tagged with the desired Tag(s).' => 'Ĉi tio uzas afiŝtipon "Intro-Tag" kaj estas etikedata per la deziritaj tago(j).',
'Widgets tag &ndash; Sub Intro post' => 'Umaĵa etkido &ndash; sub enkonduka afiŝo',
"<p>This is a demo of a featured post.</p>\n\n<p>It will be featured whenever we have no specific \"Intro\" post to display for the current request. To see it in action, try displaying the \"Announcements\" category.</p>\n\n<p>Also note that when the post is featured, it does not appear in the regular post flow.</p>" => '<p>Jen demonstro de plej reĝa afiŝo.</p>',
"<p>b2evolution comes with an <code>.htaccess</code> file destined to optimize the way b2evolution is handled by your webseerver (if you are using Apache). In some circumstances, that file may not be automatically activated at setup. Please se the man page about <a %s>Tricky Stuff</a> for more information.</p>\n\n<p>For further optimization, please review the manual page about <a %s>Performance optimization</a>. Depending on your current configuration and on what your <a %s>web hosting</a> company allows you to do, you may increase the speed of b2evolution by up to a factor of 10!</p>" => "<p>b2evolution inkluzivas dosieron <code>.htaccess</code>, destinite por maksimumigi la traktadon de b2evolution de Apache. Laŭ iaj cirkonstancoj tiu dosiero eble ne aŭtomate estos aŭtomate aktivigita je plenumo. Bonvolu vidi la manlibran paĝon pri <a %s>Konfuzaj Aferoj</a> por pli da informoj.</p>\n\n<p>Por pluaj maksimumigoj bonvolu kontroli la manlibran paĝon pri <a %s>Rendimenta maksimumigo</a>. Depende de via nuna agordo kaj de tio, kion via <a %s>TTT-gastiga</a> firmao permesas, vi eble povos kreskigi la rapidon de b2evolution 10-oble.</p>",
'Apache optimization...' => 'Plej bona funkciado de Apaĉo…',
"<p>By default, blogs are displayed using an evoskin. (More on skins in another post.)</p>\n\n<p>This means, blogs are accessed through '<code>index.php</code>', which loads default parameters from the database and then passes on the display job to a skin.</p>\n\n<p>Alternatively, if you don't want to use the default DB parameters and want to, say, force a skin, a category or a specific linkblog, you can create a stub file like the provided '<code>a_stub.php</code>' and call your blog through this stub instead of index.php .</p>\n\n<p>Finally, if you need to do some very specific customizations to your blog, you may use plain templates instead of skins. In this case, call your blog through a full template, like the provided '<code>a_noskin.php</code>'.</p>\n\n<p>If you want to integrate a b2evolution blog into a complex website, you'll probably want to do it by copy/pasting code from <code>a_noskin.php</code> into a page of your website.</p>\n\n<p>You will find more information in the stub/template files themselves. Open them in a text editor and read the comments in there.</p>\n\n<p>Either way, make sure you go to the blogs admin and set the correct access method/URL for your blog. Otherwise, the permalinks will not function properly.</p>" => '<p>Apriore kolektoj montriĝos per etosoj. Se vi ne volas uzi etosojn, uzi la dosieron a_noskin.php.</p>',
'Skins, Stubs, Templates &amp; website integration...' => 'Etosoj, ĝermoj, ŝablonoj kaj kolektara integriĝo…',
"<p>b2evolution blogs are installed with a default selection of Widgets. For example, the sidebar of this blog includes widgets like a calendar, a search field, a list of categories, a list of XML feeds, etc.</p>\n\n<p>You can add, remove and reorder widgets from the Blog Settings tab in the admin interface.</p>\n\n<p>Note: in order to be displayed, widgets are placed in containers. Each container appears in a specific place in an evoskin. If you change your blog skin, the new skin may not use the same containers as the previous one. Make sure you place your widgets in containers that exist in the specific skin you are using.</p>" => "<p>Kolektoj de b2evolution instaliĝas kun apriora elekto de umaĵoj. Ekzemple la flankaĵo de ĉi tiu kolekto inkluzivas umaĵojn kiel kalendaron, serĉilon, liston da kategorioj, liston da XML-fluoj, ktp.</p>\n\n<p>Vi povas aldoni, forigi kaj reordigi umaĵojn de la folio kolekto-agordo en la stirila interfaco.</p>\n\n<p>Noto: por montriĝado umaĵaj metiĝis en ujojn. Ĉiu ujo aperas en specifa loko en etoso. Se vi ŝanĝas vian kolekto-etoson, la nova etoso eble ne uzos la samajn ujojn, kiuj ekzistas en la specifa etoso, kiun vi uzas.</p>",
'About widgets...' => 'Pri umaĵoj…',
"<p>By default, b2evolution blogs are displayed using an evoskin.</p>\n\n<p>You can change the skin used by any blog by editing the blog settings in the admin interface.</p>\n\n<p>You can download additional skins from the <a href=\"http://skins.b2evolution.net/\" target=\"_blank\">skin site</a>. To install them, unzip them in the /blogs/skins directory, then go to General Settings &gt; Skins in the admin interface and click on \"Install new\".</p>\n\n<p>You can also create your own skins by duplicating, renaming and customizing any existing skin folder from the /blogs/skins directory.</p>\n\n<p>To start customizing a skin, open its \"<code>index.main.php</code>\" file in an editor and read the comments in there. Note: you can also edit skins in the \"Files\" tab of the admin interface.</p>\n\n<p>And, of course, read the <a href=\"%s\" target=\"_blank\">manual on skins</a>!</p>" => "<p>Apriore b2evolution-kolektoj montriĝos per la etoso evoskin.</p>\n\n<p>Vi povas ŝanĝi la etoson uzatan de iu ajn kolekto per redaktado de la kolekto-agordo en la stirila interfaco.</p>\n\n<p>Vi povas elŝuti aldonajn etosojn el <a href=\"http://skins.b2evolution.net/\">la etosa ejo</a>. Por instali ilin elpaku en la dosierujojn <cite>/blogs/skins/</cite>, navigu al Tutprograma agordo &gt; Etosoj en la stirila interfaco kaj klaki sur \"Instali novan\".</p>\n\n<p>Vi ankaŭ povas krei proprajn etosojn per duobligo, alinomado aŭ alproprigo de iu jama etosa dosierujo el la dosierujo /blogs/skins.</p>\n\n<p>Por ekagordi etoson malfermu la dosieron '<cite>index.main.php</cite>' en tekstoredaktilo kaj legi la komentojn en tio. Noto: Vi povas ankaŭ redakti etosojn sub la langeto \"Dosieroj\" en la stirila interfaco.</p>\n\n<p>Kaj kompreneble legu la <a href=\"%s\">manlibron pri etosoj</a>!</p>",
'About skins...' => 'Pri etosoj…',
'Sunset' => 'Sunsubiro',
'Bus Stop Ahead' => 'Aŭtobusa haltejo antaŭe',
"Heading\n=======\n\nSub-heading\n-----------\n\n### H3 header\n\n#### H4 header ####\n\n> Email-style angle brackets\n> are used for blockquotes.\n\n> > And, they can be nested.\n\n> ##### Headers in blockquotes\n>\n> * You can quote a list.\n> * Etc.\n\n[This is a link](http://b2evolution.net/) if Links are turned on in the markdown plugin settings\n\nParagraphs are separated by a blank line.\n\n    This is a preformatted\n    code block.\n\nText attributes *Italic*, **bold**, `monospace`.\n\nShopping list:\n\n* apples\n* oranges\n* pears\n\nThe rain---not the reign---in Spain." => "Ĉapo\n=======\n\nSubĉapo\n-----------\n\n### Trianivela ĉapo\n\n#### Kvaranivela ĉapo ####\n\n> Retpoŝtmesaĝstilaj angulaj krampoj\n> estas uzeblaj por blokaj citaĵoj.\n\n> > Kaj estas nesteblaj.\n\n> ##### Ĉapoj en blokaj citaĵoj\n>\n> * Eblas citi liston.\n> * Ktp\n\n[Jen ligilo](http://b2evolution.net/) se ligiloj estas aktivigitaj en la agordo de la kromprogramo Markdown\n\nAlineoj estas apartigitaj per vaka linio.\n\n    Jen antaŭformatita\n    kodbloko.\n\nTekstaj atributoj estas *oblikva*, **grasa**, `egallarĝa`.\n\nButikuma listo:\n\n* pomoj\n* oranĝoj\n* piroj\n\nLa pluvo--ne la rego--en Hispanujo.",
'About Forums' => 'Pri forumoj',
"<p>This is the first topic.</p>\n\n<p>It appears in a single category.</p>" => "<p>Jen la unua temo.</p>\n\n<p>Ĝi aperas en unuopa kategorio.</p>",
'First Topic' => 'Unua temo',
"<p>This is the second topic.</p>\n\n<p>It appears in multiple categories.</p>" => "<p>Jen la dua temo.</p>\n\n<p>Ĝi aperas en pluraj kategorioj.</p>",
'Second topic' => 'Dua temo',
"<p>This topic has an image attached to it. The image is automatically resized to fit the current blog skin. You can zoom in by clicking on the thumbnail.</p>\n\n<p>Check out the photoblog (accessible through the links at the top) to see a completely different skin focused more on the photos than on the blog text.</p>" => "<p>Ĉi tiu afiŝo havas bildon almetita al ĝi. La bildo aŭtomate aligrandiĝas por adaptiĝi al la nuna kolekto-etoso. Vi povas zomi per alklaki la miniaturon.</p>\n\n<p>Rigardi la fotan kolekton (atingebla per la ligiloj supre de la paĝo) por rigardi tute alian etoson pli taŭgan por fotoj ol por kolekto-teksto.</p>",
'Image topic' => 'Bilda temo',
"<p>This is page 1 of a multipage topic.</p>\n\n<blockquote><p>This is a Block Quote.</p></blockquote>\n\n<p>You can see the other pages by clicking on the links below the text.</p>" => "<p>Jen la unua paĝo de plurpaĝa temo.</p>\n\n<blockquote><p>Jen bloka citaĵo.</p></blockquote>\n\n<p>Vi povas vidi la aliajn paĝojn per alklakado de la ligiloj sube de la teksto.</p>",
'This is a multipage topic' => 'Jen plurpaĝa temo',
"<p>This is an extended topic with no teaser. This means that you won't see this teaser any more when you click the \"more\" link.</p>\n\n[teaserbreak]\n\n<p>This is the extended text. You only see it when you have clicked the \"more\" link.</p>" => '<p>Jen etendita temo kun neniu komenca eltiraĵo. Alivorte vi ne plu vidos la komencon kiam vi alklakos la ligilon "plu".</p>',
'Extended topic with no teaser' => 'Etendita temo sen komenca eltiraĵo',
"<p>This is an extended topic. This means you only see this small teaser by default and you must click on the link below to see more.</p>\n\n[teaserbreak]\n\n<p>This is the extended text. You only see it when you have clicked the \"more\" link.</p>" => "<p>Jen etendita temo. Alivorte vi vidos nur etan eltiraĵon aŭtomate kaj vi devos alklaki la suban ligilon por vidi pliajn.</p>\n\n[teaserbreak]\n\n<p>Jen etendita teksto. Vi vidos ĝin nur post kiam vi alklakis la ligilon \"plu\"</p>",
'Extended topic' => 'Etendita temo',
'Markdown examples' => 'Markdown-ekzemploj',
"This is the main introduction for this demo online manual. It is a post using the type \"Intro-Front\". It will only appear on the front page of the manual.\n\nYou may delete this post if you don't want such an introduction.\n\nJust to be clear: this is a **demo** of a manual. The user manual for b2evolution is here: http://b2evolution.net/man/." => "Jen la ĉefcenkonduko por la demonstra enreta manlibro. Ĝi estas afiŝo kun la tipo \"Intro-Front\". Ĝi aperos nur en la frontpaĝo de la manlibro.\n\nVi rajtas forigi la afiŝon se vi ne volas tian enkondukon.\n\nSole por klarigo: jen <em>demonstraĵo</em> de manlibro. La <a href=\"http://b2evolution.net/man/\">uzanto-manlibro</a> estas enrete disponebla.",
'Welcome here!' => 'Bonvenon!',
'Chapter Intro' => 'Ĉapitra enkonduko',
'This is an introduction for this chapter. It is a post using the "intro-cat" type.' => 'Jen enkonduko por la ĉapitro. Ĝi estas afiŝo kun la tipo "intro-cat".',
'Contrary to the other sections which are explictely sorted by default, this section is sorted alphabetically by default.' => 'Kontraŭa al la aliaj sekcioj, kiuj malimplice aŭtomate estas ordigita, ĉi tiu sekcio estas aŭtomate alfabete ordigita.',
'About this manual' => 'Pri la manlibro',
"<p>This is the first page.</p>\n\n<p>It appears in a single category.</p>" => "<p>Jen la unua paĝo.</p>\n\n<p>Ĝi aperas en unuopa kategorio.</p>",
'First Page' => 'Unua paĝo',
"<p>This is the second page.</p>\n\n<p>It appears in multiple categories.</p>" => "<p>Jen la dua paĝo.</p>\n\n<p>Ĝi aperas en pluraj kategorioj.</p>",
'Second Page' => 'Dua paĝo',
'Wiki Tables' => 'Vikiaj tabeloj',
"<p>This is the sports post.</p>\n\n<p>It appears in sports category.</p>" => "<p>Jen la sporta afiŝo.</p>\n\n<p>Ĝi aperas en la kategorio Sportoj.</p>",
'Sports post' => 'Sporta afiŝo',
"<p>This is the second sports post.</p>\n\n<p>It appears in sports category.</p>" => "<p>Jen la dua afiŝo.</p>\n\n<p>Ĝi aperas en la kategorio Sportoj.</p>",
'Second sports post' => 'Dua sporta afiŝo',
