'We cannot automatically create or update your config file [%s]!' => 'Ni ne eblas aŭtomate krei aŭ ĝisdatigi vian agordan dosieron [%s]!',
'There are two ways to deal with this:' => 'Estas du manieroj por trakti ĉi tion:',
'You can allow the installer to create the config file by changing permissions for the /conf directory:' => 'Vi povas permesi, ke la instalilo kreu la agordan dosieron per ŝanĝado de antigopermesoj por la dosierujo /conf:',
'Make sure there is no existing and potentially locked configuration file named <code>%s</code>. If so, please delete it.' => 'Certigi, ke estas nenia jama kaj eble ŝlosita agorda dosiero <code>%s</code>. Se tia, bonvolu forigi ĝin',
'<code>chmod 777 %s</code>. If needed, see the <a %s>online manual about permissions</a>.' => '<code>chmod 777 %s</code>. Se necese, vidi la <a %s>retan manlibron pri atingopermesoj</a>.',
'Come back to this page and refresh/reload.' => 'Reveni al ĉi tiu paĝo kaj reŝargi.',
'Alternatively, you can update the config file manually:' => 'Alternative vi povas permane ĝisdatigi la agordan dosieron:',
'Create a new text file with a text editor.' => 'Krei novan platan dosieron per tekstoredaktilo…',
'Copy the contents from the box below.' => 'Kopii el la suba teksta kampo la enhavon.',
'Paste them into your local text editor. <strong>ATTENTION: make sure there is ABSOLUTELY NO WHITESPACE after the final <code>?&gt;</code> in the file.</strong> Any space, tab, newline or blank line at the end of the conf file may prevent cookies from being set when you try to log in later.' => 'Alglui al via tekstoredaktilo ilin. <strong>AVERTO: certigi, ke estas TUTE NENIA BLANKA SPACO post la fina <code>?&gt;</code> en la dosiero. </strong> Iu spaceto, tabo, novlinio, aŭ vaka linio je la fino de la agorda dosiero eble preventas konservadon de kuketoj kiam vi pli malfrue ensaluti.',
'Save the file locally under the name <code>_basic_config.php</code>' => 'Loke konservi la dosieron sub la nomo <code>_basic_config.php</code>',
'Upload the file to your server, into the <code>/_conf</code> folder.' => 'Alŝuti la dosieron al via servilo en la dosierujon <code>/_conf</code>.',
