'This is how your _basic_config.php should look like:' => 'Jen kiel aperos la dosiero _basic_config.php:',
'Resetting the base configuration is currently disabled for security reasons.' => 'Restarigi la bazan agordon aktuale estas malaktivigita pro sekurecaj kialoj.',
'To enable it, please go to the %s file and change: %s to %s' => 'Por aktivigi ĝin bonvolu iri al la dosiero %s kaj ŝanĝi de %s al %s',
'Then reload this page and a reset option will appear.' => 'Tiam reŝargi ĉi tiun paĝon kaj elekto por restarigado aperos.',
'The basic configuration file (<code>/conf/_basic_config.php</code>) has not been created yet. You can do automatically generate it by filling out the form below.' => 'La baza agorda dosiero dosiero (<code>/conf/_basic_config.php</code>) ankoraŭ ne kreiĝis. Vi povas aŭtomate generi ĝin per plenigado de la suba formulario.',
'This is the minimum info we need to set up b2evolution on this server:' => 'Jen la minimumaj informoj, kiuj vi bezonos por la instalado de b2evolution en ĉi tiu servilo:',
'Database you want to install into' => 'Datumbazo en kiu vi volas instali',
'b2evolution stores blog posts, comments, user permissions, etc. in a MySQL database. You must create this database prior to installing b2evolution and provide the access parameters to this database below. If you are not familiar with this, you can ask your hosting provider to create the database for you.' => 'b2evolution konservas afiŝojn, komentojn, atingopermesojn ktp en MySQL-datumbazo. Vi devas krei tiun datumbazon antaŭ instalado de b2evolution kaj doni la atingajn parametrojn al tiu datumbazo ĉi-sube. Se vi ne familiaras kn tio, vi povas peti, ke via gastiganto kreu la datumbazon por vi.',
'Typically looks like "localhost" or "sql-6" or "sql-8.yourhost.net"...' => 'Tipe similas "localhost" aŭ "sql-6" aŭ "sql-8.yourhost.net"…',
