'WARNING: Some of your tables have different charset than the expected %s. It is strongly recommended to upgrade your database charset by running the preselected task below:' => 'AVERTO: Iuj el viaj tabeloj havas kodoprezenton alian ol %s. Forte rekomendinde estas promocii vian datumbazan kodoprezenton per la suba antaŭelektita laboro:',
'The installation can be done in different ways. Choose one:' => 'La instalado povas fariĝi laŭ diversaj manieroj. Elektu iun:',
